package com.sd.shop.potatoes;

import com.sd.shop.potatoes.entities.Role;
import com.sd.shop.potatoes.entities.Image;
import com.sd.shop.potatoes.entities.Product;
import com.sd.shop.potatoes.entities.User;
import com.sd.shop.potatoes.repositories.*;
import lombok.RequiredArgsConstructor;
import lombok.extern.slf4j.Slf4j;
import org.springframework.boot.CommandLineRunner;
import org.springframework.boot.autoconfigure.condition.ConditionalOnProperty;
import org.springframework.stereotype.Component;

@Component
@ConditionalOnProperty(
        prefix = "command.line.runner",
        name = "enabled",
        havingValue = "true",
        matchIfMissing = false
)
@RequiredArgsConstructor
@Slf4j
public class PotatoesRunner implements CommandLineRunner {
    private final ProductRepository productRepository;
    private final CartRepository cartRepository;
    private final RoleRepository roleRepository;
    private final UserRepository userRepository;
    private final ImageRepository imageRepository;

    @Override
    public void run(String... args) throws Exception {
        log.info("Running data filling...");

        log.info("Starting population product population with images");
        Product savedProduct = productRepository.save(new Product(
                "Yukon Gold",
                "Yukon Gold potatoes have finely flaked yellowish-white skin with light yellow flesh. They're bright, vegetal and slightly sweet, with a smooth, slightly waxy texture and moist flesh. They're best for boiling, baking and making French fries. They'll also stand up well to grilling, pan frying and roasting.",
                5,
                2.75,
                Product.Currency.EUR
        ));


        imageRepository.save(new Image(
                "image 1",
                "data:image/png;base64, ",
                savedProduct.getId()
        ));

        imageRepository.save(new Image(
                "image 2",
                "data:image/png;base64, ",
                savedProduct.getId()
        ));

        savedProduct = productRepository.save(new Product(
                "Idaho Russet",
                "Idaho Russet potatoes are russet-skinned with white flesh. They're what we typically imagine when we think of potatoes. They have a neutral potato flavor, a fluffy, creamy and soft texture, and are best for baking, mashing and making French fries. They're also very absorbent, so are great paired with butter and cream -- think mashed potatoes. Just don't try using Idaho Russets for potato salads, gratins or any dish that requires the potatoes to hold their shape.",
                10,
                3.75,
                Product.Currency.EUR
        ));

        imageRepository.save(new Image(
                "image 3",
                "data:image/png;base64, ",
                savedProduct.getId()
        ));

        imageRepository.save(new Image(
                "image 4",
                "data:image/png;base64, ",
                savedProduct.getId()
        ));

        log.info("Starting user filling with authorities");

        Role savedBuyerRole = roleRepository.save(new Role(Role.Type.BUYER));
        Role savedAdminRole = roleRepository.save(new Role(Role.Type.ADMIN));
        Role savedMerchantRole = roleRepository.save(new Role(Role.Type.MERCHANT));

        userRepository.save(new User(
                "Jonas",
                "Jonas",
                "Jonauskas",
                "password",
                "password",
                savedBuyerRole
        ));

        log.info("Exiting data filling...");
//        System.exit(0);
    }
}
